import re

text2 = """"""


def if_preceded_by_three_caps(index):
    if (text2[index - 4]).isupper():
        return False
    for range_idx in range(1, 4):
        if text2[index - range_idx].isupper():
            continue
        else:
            return False
    return True


def if_succeeded_by_three_caps(index):
    if (text2[index + 4]).isupper():
        return False
    for curr_idx in range(1, 4):
        if text2[index + curr_idx].isupper():
            continue
        else:
            return False

    return True


key = ""
for current_idx in range(len(text2)):
    if text2[current_idx].islower():
        if if_preceded_by_three_caps(current_idx) and if_succeeded_by_three_caps(current_idx):
            key = key + text2[current_idx]

print(key)


# option 2
key=""
eligible_words_list = re.findall(r"[^A-Z][A-Z]{3}[a-z][A-Z]{3}[^A-Z]",text2)
for each_word in eligible_words_list:
    key = key + each_word[4]

print(key)
